import React, { useState } from "react";
import "./Cart.css";
import Box from "@mui/material/Box";
import {
  Button,
  Card,
  CardContent,
  TextField,
  Typography,
} from "@mui/material";

function Cart() {

    let task = ['swimming', 'cycling']
const [newTask, setNewTask] = useState();



  return (
    <div>
      <h1>Cart</h1>
      <h3>TO DO LIST</h3>
      <Box
        sx={{ display: "flex", width: "100%", justifyContent: "space-between" }}
      >
        <Card className="card" sx={{ width: "30%" }}>
          <CardContent>
            <Typography sx={{ fontWeight: "700" }}>Task pending</Typography>
            <Typography>{task}</Typography>
          </CardContent>
        </Card>
        <Card className="card" sx={{ width: "30%" }}>
          <CardContent>
            <Typography sx={{ fontWeight: "700" }}>Task Completed</Typography>
          </CardContent>
        </Card>
        <Card className="card" sx={{ width: "30%" }}>
          <CardContent>
            <Typography sx={{ fontWeight: "700" }}>Add Task</Typography>
            <div style={{ display: "flex", justifyContent: "space-between" }}>
              <TextField placeholder="Add Task" size="small"></TextField>
              <Button variant="outlined">Submit</Button>
            </div>
          </CardContent>
        </Card>
      </Box>
    </div>
  );
}

export default Cart;
